// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract ProductStore is ERC721 {
    using Counters for Counters.Counter;
    Counters.Counter private _productIdCounter;

    IERC20 public token;

    event ProductPurchased(address indexed buyer, uint256 productId);

    struct Product {
        string name;
        uint256 price; // Assume price is in tokens
    }

    mapping(uint256 => Product) public products;

    constructor(address _tokenAddress) ERC721("ProductBill", "PBL") {
        token = IERC20(_tokenAddress);

        // Add some example products
        addProduct("Product A", 1);
        addProduct("Product B", 2);
    }

    function addProduct(string memory _name, uint256 _price) internal {
        uint256 productId = _productIdCounter.current();
        products[productId] = Product(_name, _price);
        _productIdCounter.increment();
    }

    function buyProduct(uint256 _productId) external returns (uint256) {
        Product storage product = products[_productId];

        // Check if the product exists
        require(bytes(product.name).length > 0, "Product does not exist");

        // Transfer tokens for the product
        token.transferFrom(msg.sender, address(this), product.price);

        // Mint a new NFT for the user as a bill
        _mint(msg.sender, _productId);

        // Emit an event for the purchase
        emit ProductPurchased(msg.sender, _productId);

        return _productId;
    }

    function getBillDetails(uint256 _billId) external view returns (string memory, uint256) {
        require(_billId>=0, "Bill does not exist");

        // Retrieve product details associated with the NFT bill
        Product storage product = products[_billId];
        return (product.name, product.price);
    }
}

